(1) Morte de anciãos indígenas na pandemia ameaça a preservação de línguas inteiras. Os povos indígenas têm sofrido perdas irreparáveis por causa do novo coronavírus com a morte de seus idosos, que são líderes e guardiões de toda uma cultura, e, em alguns casos, os últimos falantes fluentes de suas línguas maternas. Fonte: BBC; Foto: AFP.

(2) Índia acusa China de novas provocações na região de fronteira. Os dois países disputam uma região de fronteira. Em julho, houve um confronto entre soldados indianos e chineses. Agora, a Índia afirma que os vizinhos estão entrando na sua região. Fonte: Reuters; Foto: Mukesh Gupta/Reuters.

(3) Brasil concede refúgio a quase 8 mil venezuelanos de uma vez. Comitê aprovou nova leva de reconhecimento do status de refugiado a cidadãos da Venezuela, que respondem por mais da metade das solicitações ainda em andamento. Fonte: G1; Foto: Ricardo Moraes/Reuters.

(4) Coronel da PM deve ser efetivado na presidência do ICMBio. Duas fontes ouvidas pelo G1 confirmaram a informação. Fernando Cesar Lorencini também é Diretor de Planejamento, Administração e Logística do instituto desde abril de 2019. Fonte: G1; Foto: ICMBio.

(5) EUA impõem restrições a diplomatas chineses; há regras até para o perfil dos consulados em redes sociais. Os EUA decidiram que os diplomatas chineses precisarão pedir autorização para visitar universidades, marcarem reuniões com líderes locais e até promover eventos culturais em solo americano. Fonte: G1; Foto: Adrees Latif/Reuters.

(6) Governo do Sudão e movimentos rebeldes assinam acordo de paz. Acordo é um passo significativo para acabar com 17 anos de guerra no país. Fonte: Reuters; Foto: Zohra Bensemra/Reuters.

(7) Presidente do Líbano pede por Estado laico e mudança do sistema. Em um discurso às vésperas do centenário do país, Michel Aoun afirmou que somente "Estado laico" é capaz de proteger pluralismo. Fonte: RFI; Foto: Dalati Nohra/Handout/Reuters.

